        <option>New</option>
        <option>Started</option>
        <option>Resolved</option>
      </select>
      <h2>Status</h2>

      {/* depends on type */}
      <h2>Deadline</h2>
      <h2>Type</h2>
      {/* Feature or Bug */}

      <h2>Screenshot</h2>
      {/* only .gif and .png */}
    </div>
  )
}

export default Bug
